import styled from 'styled-components';

export const NavBarBackground = styled.img<{ imageSrc: string }>(
    ({imageSrc}) =>
    `background-image: url(${imageSrc}); 
    display: flex;
    height: 100%;
    width: 100%;  
    object-fit: scale-down;
`
);

export const NavBarContainer = styled.div
    `
    width: 100%;
    height: 10vh;
    `;
